import React, { useState } from "react";
import { Sidebar, Menu, MenuItem, SubMenu, useProSidebar } from "react-pro-sidebar";
import { Link } from "react-router-dom";
import { ProSidebarProvider } from "react-pro-sidebar";
import "@react-pro-sidebar/core/dist/css/styles.css"; // Ensure you have this

const MySidebar = () => {
  const { collapseSidebar, collapsed } = useProSidebar(); // Hook for sidebar control

  return (
    <ProSidebarProvider>
      <Sidebar>
        <Menu>
          <MenuItem component={<Link to="/" />}>Home</MenuItem>
          <MenuItem component={<Link to="/settings" />}>Settings</MenuItem>
          <SubMenu label="Services">
            <MenuItem component={<Link to="/services/web" />}>Web Development</MenuItem>
            <MenuItem component={<Link to="/services/app" />}>App Development</MenuItem>
          </SubMenu>
        </Menu>
      </Sidebar>

      {/* Toggle button */}
      <button onClick={() => collapseSidebar()} style={{ marginTop: 20 }}>
        {collapsed ? "Expand" : "Collapse"}
      </button>
    </ProSidebarProvider>
  );
};

export default MySidebar;
